import React, { useEffect, useState } from 'react';
import { useNavigate , useParams } from 'react-router-dom';

async function fetchAuthcheck(userid, navigate, setIsLoggedIn) {
  try {
    const response = await fetch(`http://localhost:3001/authcheck?userid=${userid}`, {
      credentials: 'include',
    });
    if (response.ok) {
      const data = await response.json();
      if (data.isLogin) {
        setIsLoggedIn(true);
      } else {
        setIsLoggedIn(false);
        navigate("/login");
      }
    } else {
      console.error('서버에서 로그인 상태를 확인하는 동안 오류 발생:', response.statusText);
    }
  } catch (error) {
    console.error('API 요청 오류:', error);
  }
}

async function fetchUserInfo(userid, setUserInfo) {
  try {
    const response = await fetch(`http://localhost:3001/myinfo?userid=${userid}`, {
      credentials: 'include',
    });
    if (response.ok) {
      const data = await response.json();
      if (!data.error) {
        setUserInfo(data);
      } else {
        console.error('사용자 정보 가져오기 오류:', data.error);
      }
    } else {
      console.error('사용자 정보 가져오기 오류:', response.statusText);
    }
  } catch (error) {
    console.error('API 요청 오류:', error);
  }
}

